INSERT INTO `game_gift` VALUES (1,'1.png','11.png',50000,-1,'【给你最智能的温暖陪伴】机器人小5','教宝宝拼音字母，给宝宝讲故事，陪宝宝做游戏，提醒你的每日计划……一个小5通通搞定，最先进的家用智能机器人，给你最智能的温暖陪伴。','机器人小5'),(2,'2.png','22.png',30000,-1,'【优惠那么大 我想去看看】3000元优惠券','3000元，3000元，3000元，重要的事情说三遍，大尺度优惠，就是这么任性，不用剁手，只需动手，喜欢小5就带它回家吧。','3000元优惠券'),(3,'3.png','33.png',25000,10,'【唯有钻戒和爱不可辜负】精美钻戒','独特的切割工艺，精巧的戒壁设计，唯有钻戒和爱不可辜负，给她一个blingbling的么么哒~',' 精美钻戒'),(4,'4.png','44.png',16000,5,'【电子书阅读神器】kindle','专为电子书星人设计的便携阅读器kindle，海量图书，一手在握，比铅笔还纤薄，比纸书还轻巧，给你最极致的电子阅读体验。','kindle');
