#
# Data for table "game_rule"
#

/*!40000 ALTER TABLE `game_rule` DISABLE KEYS */;
INSERT INTO `game_rule` VALUES (1,'积分获得的方法','1.发送邀请码邀请朋友下载注册，每成功邀请一个用户下载注册双方都可获得100积分。\r\n2.用户每天玩手机端的游戏可以获得积分,每天20积分最高。\r\n3.第一天签到可以获得1积分；第二天可以获得2积分；第三天可以获得3积分；以后如果不断签到，每天可以得到3积分。\r\n4.有益改进意见的反馈将对于手机APP的改进意见发送到后台，一经采用可以获得积分奖品。'),(2,'积分获得的限制','1.每个用户每天的邀请数量最高为20个。\r\n2.用户通过使用手机游戏每天最多可以获取到10积分。\r\n3.签到每天最多可以获得到3积分。\r\n4.对于产品功能有益意见的反馈，每天最多可以获得50积分的奖励，以及相应的礼品。\r\n5.对手机Bug的反馈，用户每天最多可以获得10积分的奖励。');
/*!40000 ALTER TABLE `game_rule` ENABLE KEYS */;

